import { Box, Card, CardContent, CardHeader, Container, Grid, Paper, Typography } from '@mui/material'
import { withStyles } from '@mui/styles'
import React, { useEffect, useState } from 'react'

const styles = {
    mainGridClass:{
        backgroundColor:'lightBlue',
        padding:'20px',
        borderRadius:'50px'
    },
    innerBoxClass1:{
        padding:'20px',
        backgroundColor:'orange',
        display:'flex',
        flexDirection:'row'
    }

}


function ProfileComponent(props) {
    const {classes} = props;
    const [stackList,setStackList] = useState([])
    useEffect(()=>{
        setStackList([{name:'Card1',price:30},{name:'Card2',price:20},{name:'Card3',price:10}])
    },[])
  return (
    <>  <Paper>
        <Container>
        <Grid className={classes.mainGridClass}>
            <Box className={classes.innerBoxClass1}>
            {stackList.map((data)=>
                <Card>
                    <CardHeader title= { data.name}>
                    </CardHeader>
                    <CardContent>
                        {data.price}
                    </CardContent>
                </Card>)}
            </Box>
            </Grid></Container>
        </Paper>
    </>
  )
}
export default withStyles(styles) (ProfileComponent)
